_firebaseMessaging.configure(
      onMessage: (Map<String, dynamic> message) async {
        print("onMessage: $message");
      },
      onBackgroundMessage: myBackgroundMessageHandler,
      onLaunch: (Map<String, dynamic> message) async {
        print("onLaunch: $message");
      },
      onResume: (Map<String, dynamic> message) async {
        print("onResume: $message");
      },
    );

`onMessage`, `onResume`, `onLaunch` sudah bisa, seperti whatsapp pun sudah bisa, ini masalahnya gimana buat simulate`onBackgroundMessage` gimana cara biar trigger callback ini kepanggil di ios, kalau di android itu tinggal `notification` nya di isi `null`

